import React from 'react';
import Table from 'react-bootstrap/Table';
import Card from 'react-bootstrap/Card';
import Emoji from './Emoji';
import HistoryTab from './HistoryTab';
import AdminTab from './AdminTab';


const DownloadsTable = () => {

  // fetch('./downloadsevents.json')
  // .then(response => {return response.json();})
  // .then(data => console.log(data));

  // const data = require('./downloadsevents.json');
  // console.log(data);

  const data =[
    {
      "_id" : ObjectId("6069e5a6389064121b0c3a3c"),
      "socket" : "uS1-SK23CC6kLD-dAAAB",
      "songId" : "6",
      "downloadTime" : ISODate("2021-04-04T16:13:26.117Z"),
      "__v" : 0
    },
    {
      "_id" : ObjectId("6069e5a7389064121b0c3a3d"),
      "socket" : "uS1-SK23CC6kLD-dAAAB",
      "songId" : "7",
      "downloadTime" : ISODate("2021-04-04T16:13:27.106Z"),
      "__v" : 0
    },
    {
      "_id" : ObjectId("6069e5a7389064121b0c3a3e"),
      "socket" : "uS1-SK23CC6kLD-dAAAB",
      "songId" : "8",
      "downloadTime" : ISODate("2021-04-04T16:13:27.569Z"),
      "__v" : 0
    },
    {
      "_id" : ObjectId("6069e861cecd33131ef6a929"),
      "socket" : "y58Q6sHl9cLBPR1wAAAE",
      "songId" : "5",
      "downloadTime" : ISODate("2021-04-04T16:25:05.548Z"),
      "__v" : 0
    },
    {
      "_id" : ObjectId("6069e862cecd33131ef6a92a"),
      "socket" : "y58Q6sHl9cLBPR1wAAAE",
      "songId" : "6",
      "downloadTime" : ISODate("2021-04-04T16:25:06.599Z"),
      "__v" : 0
    }];

  return(
  <div name="Downloads History Table" Style="margin: 7em;">
    <AdminTab />
    <HistoryTab selectProp="event" />
    <Card>
      <Card.Body>
        <h3 Style="text-align:left;"><Emoji symbol="🎧"/> Downloads History Table</h3>
      </Card.Body>
    </Card>

    <Table striped bordered hover>
      <thead>
        <tr>
          <th>ID</th>
          <th>Socket</th>
          <th>Sond ID</th>
          <th>Download Time</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>ObjectId("6069e5a6389064121b0c3a3c")</td>
          <td>uS1-SK23CC6kLD-dAAAB</td>
          <td>6</td>
          <td>2021-04-04 16:13:26.117Z</td>
        </tr>
        <tr>
          <td>ObjectId("6069e5a6389064121b0c3a3c")</td>
          <td>uS1-SK23CC6kLD-dAAAB</td>
          <td>6</td>
          <td>2021-04-04 16:13:26.117Z</td>
        </tr>
        <tr>
          <td>ObjectId("6069e5a6389064121b0c3a3c")</td>
          <td>uS1-SK23CC6kLD-dAAAB</td>
          <td>6</td>
          <td>2021-04-04 16:13:26.117Z</td>
        </tr>
      </tbody>
    </Table>

  </div>
  );
}

export default DownloadsTable;
